import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Manzanita Square</h1>
        <div>
          <h2>Title</h2>
          <p>Date posted</p>
        </div>
      </header>
    </div>
  );
}

export default App;
